"Hasta al 8 de Diciembre. \u201cVII Premio Nacional de Pintura Banco Central 2013\u201d . El car\u00e1cter itinerante, distintivo federal de este premio, marca la clara orientaci\u00f3n de contribuir a la difusi\u00f3n del arte nacional, exhibiendo a artistas de diversas regiones como una manera de estimular el contacto con el p\u00fablico en m\u00faltiples espacios culturales del pa\u00eds; 30 obras finalistas que integran esta muestra, de ellas 9 en la categor\u00eda de menores de 35 a\u00f1os. El Jurado del Gran Premio Homenaje ha distinguido por su trayectoria al artista Gyula Kosice, cuya producci\u00f3n marca un hito fundamental en la historia del arte argentino desde los a\u00f1os 40 del siglo XX al momento actual.\r\n","DireccionEvento":"MATHEU 1851","FechaHoraFin":"20141113T213000","FechaHoraInicio":"20141113T190000","Frecuencia":"Semanalmente, jueves hasta el 08\/12\/2014.","IdArea":2,"IdCalendario":2,"IdEvento":3565,"IdSubarea":2,"Latitud":-38.019974068042,"Longitud":-57.552942165598,"Lugar":"Centro Cultural Victoria Ocampo","NombreArea":"Cultura","NombreCalendario":"cultura mar del plata","NombreEvento":"VII Premio Nacional de Pintura Banco Central 2013","NombreSubAreaFormat":"-Ninguna-","NombreSubarea":"General Cultura","Precio":12,"Repetir":"RRULE:FREQ=WEEKLY;BYDAY=TH;UNTIL=20141208T220000Z","RutaImagen":"http:\/\/appsb.mardelplata.gob.ar\/Consultas\/nCalendario\/Archivos\/2\/2\/Banco central_20141023102928.jpg","RutaImagenMiniatura":"http:\/\/appsb.mardelplata.gob.ar\/Consultas\/nCalendario\/Archivos\/2\/2\/villa victoria_20141023102928.jpg","TodoDia":false,"ZonaHoraria":"America\/Argentina\/Buenos_Aires"},{"Altura":1187,"Calle":"COLON, CRISTOBAL","DescripcionCalendario":"","DescripcionEvento":"EL ARTE DEL FILETEADO","Destacado":true,"DetalleTexto":"Del 07 al 24 de Noviembre | El fileteado es una expresi\u00f3n art\u00edstica y popular que nace en Buenos Aires a principios del siglo XX, creado por inmigrantes italianos y franceses. Las f\u00e1bricas d